// RUN: objc3c -fobjc-version=3 -DMOD53_MODULE_ALPHA --emit-module Alpha.objcmod --module-name Alpha %s
// RUN: objc3c -fobjc-version=3 -DMOD53_MODULE_BETA --emit-module Beta.objcmod --module-name Beta %s
// RUN: objc3c -fobjc-version=3 --import-module Alpha.objcmod --import-module Beta.objcmod -fsyntax-only %s
#if defined(MOD53_MODULE_ALPHA)
const int SharedCounter = 1;
#elif defined(MOD53_MODULE_BETA)
const int SharedCounter = 2;
#else
@import Alpha;
@import Beta;
int readCounter(void) {
    return SharedCounter;
}
#endif
